Soldier, wake – the day is peeping,
Through the slats of battered blinds;
Mist like spectral fingers sweeping
Over dreams you leave behind.

Boots await with laces knotted,
Gun and pack by candle's gleam;
Every heartbeat, battle plotted
In the silence of your dream.

Sunrise spills a trembling promise,
Gold and crimson, fierce and wise;
Courage rises, soft and honest,
In the mirror of your eyes.

Soldier, wake – the dawn is calling;
Hope and fear entwine and sweep.
March to meet the light's enthralling;
Carry strength the night can't keep.
